import { Icon, Heading } from "../../components";
import { UserOverview_Styles, PlayerOverview_Styles } from "./Dash_Styles";
import { FaDivide } from "react-icons/fa";

const Overview = ({ name = "", email = "", homePhone = "", players = [] }) => {
  return (
    <UserOverview_Styles>
      <Heading type="Small">{name}</Heading>
      {players.map(({ sport, name: n }) => (
        <>
          <Heading type="Small">{n}</Heading>
          <Icon type={sport} />
        </>
      ))}

      <span>
        <Icon type="phone" />
        <Heading type="Small">{homePhone}</Heading>
      </span>
      <span>
        <Icon type="mail" />
        <Heading type="Small">{email}</Heading>
      </span>
      <Icon type="message" messages={1} />
    </UserOverview_Styles>
  );
};

const Team_List = ({
  teams = [{ name: "Red Lions", record: "3-0", sport: "soccer" }],
}) => {
  return (
    <div className="Team_List_Container">
      {teams.map(({ name, record, sport }) => (
        <div className="Team_List_SubContainer">
          <Heading className="Team_List_Team_Heading" type="Small">
            {name}
          </Heading>
          <Heading type="Small">{record}</Heading>
          <Icon type="Soccer" />
        </div>
      ))}
    </div>
  );
};

const PlayerOverview = ({
  name = "Julia",
  dob = "7-9yr",
  teams = [],
  size = "S",
}) => {
  return (
    <PlayerOverview_Styles>
      <Heading type="Sub">{name}</Heading>
      <Heading type="Small">{dob}</Heading>
      <Icon size={size} type="shirt" />
    </PlayerOverview_Styles>
  );
};

const User = {
  Overview,
  PlayerOverview,
};

export default User;
